import React from 'react'
import './styles.css'
import data from '../00_practice/data'

const Accordian = () => {
  return (
    <div className='container'>
        {
            data ?
            data.map((item)=>
            <div className='title'>
                <h3>{item.question}</h3>
                <span>+</span>
            </div>
            )
            :null
        }
    </div>
  )
}

export default Accordian;
